Cuando empiezas a programar, el lenguaje te ofrece una serie de herramientas para facilitarte la vida. Si necesitas mostrar texto por pantalla, sólo tienes que preocuparte por pasarle el texto que quieres, pero no sabes qué está haciendo el ordenador por debajo para lograr ese objetivo. A este énfasis en preocuparte únicamente por "¿qué hace?" en lugar de "¿cómo lo hace?" se lo conoce como abstracción. Cómo ya has podido observar, puedes aprender a programar y trabajar de ello con un lenguaje de programación, pero tendrás muchos, MUCHOS PROBLEMAS . Vamos a jugar a un juego: Te presento una serie de ejercicios escritos en C#. Ya están resueltos, no quiero que escribas nada ni te pongas a programar. Antes de cada fragmento de código encontrarás una pregunta; tu objetivo es responderte a ti mismo qué está ocurriendo con sólo leerlo. Una vez que tengas clara tu respuesta, te recomiendo que investigues para descubrir si estabas en lo cierto. Si no encuentras la respuesta o sigues teniendo dudas, puedes unirte al Discord de The Nightmare Community para leer la opinión de más programadores que han pasado por esta guía, además de la mía. ¿El resultado de "score" es "2147483648"? public class Nightmare00
{ public static void Main() { int score = 2147483647; score++; }
} ¿Con qué valor se inicializa "c"? public class Nightmare01
{ public static void Main() { char c = System.Convert.ToChar(48); }
} ¿"b == 2" se está comprobando? public class Nightmare02
{ public static void Main() { int a = 4; int b = 2; if (a == 2 && b == 2) { a = b; } }
} ¿Este programa compila? public class Nightmare03
{ public static void Main() { while(true); }
} ¿Cuál es el valor de "life" después de llamar al método "Damage"? public class Nightmare04
{ public static void Damage(int life, int amount) { life -= amount; } public static void Main() { int life = 100; System.Console.WriteLine($"Initial life = {life}"); Damage(life, 25); System.Console.WriteLine($"Current life = {life}"); }
} ¿Por qué puedo acceder al valor de un índice en "gameState" si no está declarado como "string[]"? public class Nightmare05
{ public static void Main() { string gameState = "Game Over"; System.Console.WriteLine($"gameState[0] = {gameState[0]}"); }
