{ public static void Main() { unsafe { int currentWave = 42; int *pCurrentWave = &currentWave; System.Console.WriteLine($"pCurrentWave = {(int)pCurrentWave}"); } }
} ¿Te han parecido difíciles las preguntas? Como habrás podido notar, son ejercicios muy simples, pero a su vez tan básicos que no te habrás planteado hasta ahora. Le damos mucha importancia a saber cuáles son las mejores prácticas de código, ignorando por completo esos pequeños detalles que nos permiten comprender la funcionalidad de un lenguaje y usarlo a nuestro favor. Nuestro tiempo es muy valioso, y no podemos perderlo con un lenguaje de programación que no sabemos utilizar. De lo contrario, perderás una tarde entera para encontrar la solución a un problema que no entiendes, y le echarás la culpa a ese motor de videojuegos que tanto odiamos, pero al mismo tiempo amamos, porque si nos sacan de ahí, no sabemos programar nada... La abstracción no lo es todo, mira más allá y encontrarás la respuesta a muchos de tus problemas.
